import React from 'react';
import logo from './logo.svg';
import './App.css';

function getTime() {
    return new Date().toLocaleTimeString();
}


function App() {
  return (
    <div className="App">
      <h1>First react app.{getTime()}</h1>
    </div>
  );
}

export default App;
